export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},"4HgAFHV3MM":{data:{id:2022,attributes:{imdbId:"tt1496422",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTcxMzI3OTQ5MF5BMl5BanBnXkFtZTcwMzA0NzcxOA@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"},{Source:"Rotten Tomatoes",Value:"45%"},{Source:"Metacritic",Value:"45\u002F100"}],item_lang:{data:{id:2685,attributes:{title:e,plot:"Eldest son Ward Jansen is a star reporter for a Miami newspaper and has returned home with close friend Yardley to investigate a racial murder case. Younger brother Jack Jansen has returned home after a failed stint at university as a star swimmer. To help give his life some direction, Ward gives Jack a job on their investigation as their driver. But into the mix comes the fiancée of the imprisoned convict who stirs up confusing feelings of love and lust for the young Jack. Meanwhile, Ward and Yardley's investigation stirs up deep-rooted issues of race and acceptance which could cause serious consequences for everyone involved.",slug:"the-paperboy"}}},books:{data:[{id:10075,attributes:{title:e,description:i,thumbnail:j,authors:[b],firstBook:true,published:k,publisher:l,subtitle:m}},{id:10076,attributes:{title:f,description:"Moat County, Florida, 1965. Kurz nach Sonnenaufgang wird Sheriff Thurmond Call auf dem Highway gefunden, ausgeweidet wie ein Alligator, dem man ans Leder will. Die Einwohner des Countys verlangen Gerechtigkeit, und bald schon ist ein Schuldiger gefunden: Hillary Van Wetter, der unberechenbare, gewalttätige Spross einer Familie, die seit Jahrhunderten in den Sümpfen Floridas haust, soll für den Mord auf den elektrischen Stuhl. Doch es gibt Hoffnung für Hillary Van Wetter. Eine Frau namens Charlotte Bless fühlt sich zu Mördern hingezogen, auch wenn sie diese nie persönlich kennengelernt hat. Sie will Hillary aus der Todeszelle holen und verspricht zwei Reportern von der Miami Times die Story des Jahres, sollten sie den Fall neu aufrollen. Die von der Polizei vorgebrachten Beweise gegen Van Wetter waren nie stichhaltig - genau wie dessen vermeintliches Alibi. Aber die Suche nach dem Schuldigen entwickelt sich rasch zu einem tödlichen Spiel. Denn manchmal wird aus einer Lüge die Wahrheit. Pete Dexter, 1943 in Michigan geboren, arbeitete über fünfzehn Jahre als Zeitungsreporter in Philadelphia. Nachdem er im Zuge einer kontroversen Berichterstattung angegriffen und krankenhausreif geschlagen wurde, gab er seinen Beruf auf. Heute lebt er als freier Schriftsteller im Bundesstaat Washington. Pete Dexter gilt als einer der profiliertesten Drehbuchautoren Amerikas und veröffentlichte bislang sieben Romane, darunter \"Deadwood\", \"Train\" und \"Paris Trout\", für den er 1988 mit dem National Book Award ausgezeichnet wurde.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7derNAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2013-01-01",publisher:a,subtitle:"Roman"}},{id:10077,attributes:{title:e,description:i,thumbnail:j,authors:[b],firstBook:d,published:k,publisher:l,subtitle:m}},{id:10078,attributes:{title:f,description:"Accusé d'avoir éventré le shérif Call, Hillary Van Wetter attend la mort dans une prison de Floride. Eperdument éprise du condamné, Charlotte clame son innocence auprès du Miami Times qui dépêche deux journalistes sur place... Glamour, torride, réaliste et violent, Paperboy pulvérise les clichés du journalisme d'investigation.",thumbnail:a,authors:[b],firstBook:d,published:"2012-10-01",publisher:a,subtitle:"roman"}},{id:10079,attributes:{title:f,description:"Dans une cellule de la prison de Moat County, en Floride, Hillary Van Wetter attend la mort. I lest accusé d'avoir assassiné - ou plus exactement éventré - le shérif local. Pendant ce temps, une certaine Charlotte Bless adresse une lettre au Miami Times, expliquant que le condamné va être exécuté pour un crime qu'il n'a pas commis. Flairant une affaire juteuse, le journal décide d'envoyer ses deux meilleurs reporters, James et Acheman, enquêter sur place.",thumbnail:a,authors:[b],firstBook:d,published:"1996-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703517387}}("","Pete Dexter","movie",null,"The Paperboy","Paperboy","series",1,"NEW YORK TIMES BESTSELLER “An eerie and beautiful novel . . . Its secrets continue to reveal themselves long after the book has been finished.”—The New York Times Book Review The sun is rising over Moat County, Florida, when Sheriff Thurmond Call is found on the highway, gutted like an alligator. A local redneck is tried, sentenced, and set to fry. Then Ward James, hotshot investigative reporter for the Miami Times, returns to his rural hometown with a death row femme fatale who promises him the story of the decade. She’s armed with explosive evidence, aiming to free—and meet—her convicted “fiancé.” With Ward’s disillusioned younger brother Jack as their driver, they barrel down Florida’s back roads and seamy places in search of The Story, racing flat out into a shocking head-on collision between character and fate as truth takes a back seat to headline news. Now a major motion picture directed by Lee Daniels starring Matthew McConaughey, Zac Efron, David Oyelowo, and Macy Gray, with John Cusack and Nicole Kidman Praise for The Paperboy “Dexter is a writer who cuts to the bone. There is not a spare word in this searing tale. . . . A bravura performance by one of America’s most original and elegiac voices.”—People “Hip, hard-boiled and filled with memorable eccentrics . . . The Paperboy burns with the phosphorescent atmosphere of betrayal.”—Time “A wise and fascinating tale well told.”—Entertainment Weekly","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ep6olWmG8H4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-02-02","Delta","A Novel"))